const Footer = () => {
  return (
    <footer className="footer">
      <div className="container">
        <p>&copy; 2025 Dr. MAHAMADOU BASSIROU TOURE | Tous droits réservés</p>
        <p style={{ marginTop: '0.5rem', opacity: '0.8' }}>
          Médecin Chirurgien - Spécialiste en Chirurgie Générale et Spécialisée
        </p>
      </div>
    </footer>
  );
};

export default Footer;
